import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';

import { IonicModule } from '@ionic/angular';

import { SallesecPageRoutingModule } from './sallesec-routing.module';

import { SallesecPage } from './sallesec.page';

@NgModule({
  imports: [
    CommonModule,
    FormsModule,
    IonicModule,
    SallesecPageRoutingModule
  ],
  declarations: [SallesecPage]
})
export class SallesecPageModule {}
